import { exercises } from "@shared/utilities/exercise.js";

namespace S2390_1 {
  export const removeStars = (s: string): string => {
    const characters = Array.from(s);
    const n = characters.length;

    for (let i = 0; i < n; ++i) {
      if (characters[i] !== "*") continue;

      characters[i] = "";
      let j = 0;
      while (characters[i - ++j] === "");
      characters[i - j] = "";
    }

    return characters.join("");
  };
}

namespace S2390_2 {
  export const removeStars = (s: string): string => {
    const characters = Array.from(s);
    const n = characters.length;

    for (let i = 0; i < n; ++i) {
      if (characters[i] !== "*") continue;

      let count = 0;
      while (characters[i + count] === "*") {
        characters[i + count] = "";
        ++count;
      }

      let j = 0;
      let toRemove = count;
      while (toRemove > 0) {
        if (characters[i - ++j] === "") continue;
        if (characters[i - j] === undefined) break;
        characters[i - j] = "";
        --toRemove;
      }

      i += count - 1;
    }

    return characters.join("");
  };
}

namespace S2390_3 {
  export const removeStars = (s: string): string => {
    const characters = [];

    for (const c of s) {
      if (c === "*") {
        characters.pop();
      } else {
        characters.push(c);
      }
    }

    return characters.join("");
  };
}

